    [],nt"num_tags": 0,nt"name": "oa-experimental-results-species-response-experiments-on-the-effects-of-ocean-acidification-clim",nt"isopen":
    false,nt"url": null,nt"notes": "The NWFSC Ocean Acidification (OA) team
    will conduct a series of species-exposure experiments in the acidification research
    facility on N. Pacific species of economic, ecological, or conservation concern
    that are potentially vulnerable to the effects of ocean acidification, climate change,
    and deoxygenation. Working with a number of collaborators, experiments will be conducted
    on a variety of coastal species, including Pacific oyster, geoducks, mussels, Dungeness
    crab, krill, copepods, rockfish, surf smelt, herring, and several types of multi-species
    assemblages.nnOcean acidification experimental results for Dungeness crab, China
    rockfish, Pacific herring, bivalves, krill, and other species.",nt"owner_org":
